Air date: 03 September 2015
Summary [AniDB]: The second incarnation of the very popular NARUTO anime. It covers Part II of the manga storyline which takes place two years after Part I (which ends with the Sasuke Retrieval arc, episodes 107-135 of the first TV series). The anime chronology differs from the manga as the Shippuuden series happens two and a half years after the end of the first Naruto series. The story revolves mainly around Uzumaki Naruto`s and Haruno Sakura`s new adventures and their search for Uchiha Sasuke after he left Konoha-gakure (Leaf Village) to gain Orochimaru`s power. The plot also shows a more active Akatsuki in their quest for obtaining all the tailed beasts. After his failed attempt to retrieve Sasuke, Naruto learns that circumstances have granted him slightly less than three years to prepare for a confrontation with Orochimaru, who has to wait that much time before he can transfer into Sasuke`s body. Naruto also must prepare for his eventual confrontation with Akatsuki, who are after the demon sealed within him. To prepare, Naruto leaves the village and undergoes intensive training under Jiraiya. At the same time, Sakura becomes Tsunade`s apprentice, and Sasuke trains under Orochimaru. Thus, all three members of the original Team 7 are now training under one of the Legendary Sannin.
